import "../stylesheets/App.css";
import React from "react";
import TaskDetail from "./TaskDetail";

function App(props) {
  return (
    <div className="App">
      <header class="header"></header>
      <main className="container">
        <h3>Lista de Tareas</h3>
        <ul>
          <li>
            <TaskDetail />
          </li>
        </ul>
      </main>
    </div>
  );
}

export default App;
